    return (
        <section className="home">
            <div className="overlay">
                <div className="home-inner">
                    <h1 className="home-inner-title">simply vegan</h1>
                    <p className="home-inner-description">document and share your vegan journey</p>
                </div>
            </div>
        </section>
    )
}

Home.propTypes = {

}

export default Home
